import React from 'react';
import './App.css';
import { Provider } from 'react-redux'
import { createStore, applyMiddleware } from '../../../../Library/Caches/typescript/3.5/node_modules/redux';


const store = createStore(() => [], {}, applyMiddleware());

function App() {
  return (
    <Provider store={store}>
    <div>
      <h1>Hello World</h1>
    </div>
    </Provider>
  );
}

export default App;
